let Estado = document.getElementById('message')
let Operador = document.getElementById('operador')

function VerificarCadena() {
    console.clear()
    let Fila = 0;
    let Columna = 0;
    let arregloBanderas = [];
    Operador.textContent = 'Operadores Encontrados: '

    let Cadena = document.getElementById('input').value.trim();
    let Palabras = Cadena.split(' ');
    console.log(Palabras)
    for(p = 0; p < Palabras.length; p++)
    {
        let Resultado;
        let Bandera;
        Fila = 0;
        Columna = 0;
        
        for(i = 0; i < Palabras[p].length; i++){
            
            let palabra = Palabras[p]
            console.log(palabra[i])
            Columna = Alfabeto1[palabra[i]]
            let accion = (Matriz1[Fila][Columna])

                console.log('%c' + palabra[i] + ' Caracter Actual', 'color: cyan');
                console.log('%c' + Fila + ' Fila Actual', 'color: cyan');
                console.log('%c' + Columna + ' Columna Actual', 'color: cyan');
                console.log('%c' + accion + ' Valor almacenado en el la posicion designada', 'color: cyan');
                
                if(accion == 'Acepta'){
                    Resultado = Matriz1[Fila+1][65]
                    Bandera = 1
                }
                else{
                    Fila = accion;
                    let ColumnaPrueba = Alfabeto1[palabra[i+1]]
                    let accionPrueba = (Matriz1[Fila][ColumnaPrueba])
                        console.log('%c[' + Fila + '][' + ColumnaPrueba + '] Proxima Posicion usando el sig caracter', 'color: cyan')
                        console.log('%c' + accionPrueba + ' Valor del siguiente movimiento', 'color: cyan')

                    if(accionPrueba === 'Acepta'){
                        Resultado = Matriz1[Fila+1][65]
                        Bandera = 1
                    }else if(accionPrueba === 'Error'){
                        Resultado = Matriz1[Fila][ColumnaPrueba+1]
                        Bandera = 0
                    }
                    else{
                        Resultado = Matriz1[accionPrueba][ColumnaPrueba+1]
                        Bandera = 0
                    }
                }
            
        }

        arregloBanderas.push(Bandera)
        if(arregloBanderas.includes(0))
        {
            Estado.textContent = 'Cadena no Aceptada'
            Operador.textContent = Operador.textContent + Resultado + ' '
        }
        else if(arregloBanderas[0] == undefined){
            Estado.textContent = 'Cadena Vacia'
            Operador.textContent = 'Operadores Encontrados: '
        }
        else{
            Estado.textContent = 'Cadena Aceptada'
            Operador.textContent = Operador.textContent + Resultado + ' '
        }
    }
}